programming/model.html.body:
Object Oriented Model
AMF provides an object oriented model to build, modify, and traverse through units and elements. Each plugin exposes different classes matching specific domains.
Fields
Fields on classes are usually wrapped with a convenient class to avoid the use of null / undefined. These field wrappers are defined on package amf.client.model.
Available field wrappers are StrField, IntField, BoolField, DoubleField, FloatField, and AnyField.
Accessing defined field
Java    /* Accessing defined field on model. */
    final StrField defined = model.name();
    assertThat( defined.option()                              ).isPresent();
    assertThat( defined.value()                               ).isNotEmpty();
    assertThat( defined.nonNull()                             ).isTrue();
    assertThat( defined.isNull()                              ).isFalse();
    assertThat( defined.isNullOrEmpty()                       ).isFalse();
    assertThat( defined.nonEmpty()                            ).isTrue();
    assertThat( defined.is("value")                           ).isTrue();
    assertThat( defined.is(v -> v.equals("value"))            ).isTrue();

Accessing null / undefined field
Java    /* Accessing null/undefined field on model. */
    final StrField undefined = model.description();
    assertThat( undefined.option()                              ).isEmpty();
    assertThat( undefined.value()                               ).isNull(); // Defaults: String -> null, Int -> 0, Boolean -> false
    assertThat( undefined.nonNull()                             ).isFalse();
    assertThat( undefined.isNull()                              ).isTrue();
    assertThat( undefined.isNullOrEmpty()                       ).isTrue();
    assertThat( undefined.nonEmpty()                            ).isFalse();
    assertThat( undefined.is("")                                ).isFalse(); // `is` is always false for null / undefined values
    assertThat( undefined.is((String) null)                     ).isFalse(); // `is` is always false for null / undefined values
    assertThat( undefined.is(v1 -> v1 == null || v1.equals("")) ).isFalse(); // `is` is always false for null / undefined values

Annotations
Custom annotations on elements and scalars are accessible on model. 
Bellow example defines a webapi with custom annotations:
#%RAML 1.0

title:
  value: ACME Banking HTTP API
  (Hello): Title World!

version: 1.0
mediaType: application/json

annotationTypes:
  Hello: string

baseUri: acme-banking.com/apis

/customers:
    get:
      (Hello): Operation World!
      description: Returns all customers
      responses:
        200:
          body:
            application/json:

Accessing element annotations
To access element custom annotations, see customDomainProperties domain element method:
Java    /* Accessing annotated element on model. */
    final Operation operation = endpoint.operations().get(0);

    final List extensions = operation.customDomainProperties();
    assertThat( extensions  ).hasSize(1);

    final DomainExtension annotation = extensions.get(0);
    assertThat( annotation.name().value()                     ).isEqualTo("Hello");
    assertThat( annotation.extension()                        ).isInstanceOf(ScalarNode.class);
    assertThat( ((ScalarNode) annotation.extension()).value() ).isEqualTo("Operation World!");

Accessing scalar annotations
To access scalar custom annotations, see annotations > custom field method:
Java    /* Accessing annotated field on model. */
    final StrField title = model.name();

    final List extensions = title.annotations().custom();
    assertThat( extensions  ).hasSize(1);

    final DomainExtension annotation = extensions.get(0);
    assertThat( annotation.name().value()                     ).isEqualTo("Hello");
    assertThat( annotation.extension()                        ).isInstanceOf(ScalarNode.class);
    assertThat( ((ScalarNode) annotation.extension()).value() ).isEqualTo("Title World!");

WebApi plugin
AMF WebApi plugin allows to programmatically create and traverse a WebApi.
Java    final WebApi api = new WebApi()
            .withName("Spotify Web API")
            .withVersion("v1")
            .withContentType(Collections.singletonList("application/json"))
            .withAccepts(Collections.singletonList("application/json"));

    api.withServer("https://api.spotify.com/v/{version}");

    // EndPint /albums
    final EndPoint albums = api.withEndPoint("/albums");
    albums.withName("several-albums");

    final Request albumsRequest = new Request();

    albumsRequest.withQueryParameter("ids")
            .withRequired(true)
            .withName("displayName")
            .withDescription("A comma-separated list of IDs")
            .withScalarSchema("displayName").withDataType("http://www.w3.org/2001/XMLSchema#string");

    albumsRequest.withQueryParameter("market")
            .withRequired(false)
            .withName("Market")
            .withDescription(" The market (an ISO 3166-1 alpha-2 country code)")
            .withScalarSchema("Market").withDataType("http://www.w3.org/2001/XMLSchema#string");

    albums.withOperation("get")
            .withDescription("[Get Several Albums](https://developer.spotify.com/web-api/get-several-albums/)")
            .withRequest(albumsRequest);

    // EndPint /albums/{id}
    final EndPoint album = api.withEndPoint("/albums/{id}");
    album.withName("albums");

    album.withParameter("id").withName("Spotify Album ID")
            .withDescription("The Spotify ID for the albums")
            .withScalarSchema("Spotify Album ID").withDataType("http://www.w3.org/2001/XMLSchema#string");

    final Request marketRequest = new Request();
    marketRequest.withQueryParameter("market")
            .withRequired(false)
            .withName("Market")
            .withDescription(" The market (an ISO 3166-1 alpha-2 country code)")
            .withScalarSchema("Market").withDataType("http://www.w3.org/2001/XMLSchema#string");

    album.withOperation("get").withDescription(" [Get an Album](https://developer.spotify.com/web-api/get-albums/)")
            .withRequest(marketRequest);

    // EndPint /me
    final EndPoint me = api.withEndPoint("/me");
    me.withName("current-user");
    me.withOperation("get").withDescription("[Get Current User's Profile](https://developer.spotify.com/web-api/get-current-users-profile/)");

    // EndPint /me/playlists
    final EndPoint playlists = api.withEndPoint("/me/playlists");
    playlists.withName("current-user-playlists");
    final Operation get = playlists.withOperation("get");
    get.withDescription("[Get a List of Current User's Playlists](https://developer.spotify.com/web-api/get-a-list-of-current-users-playlists/)");
    get.withResponse("200").withPayload().withMediaType("application/json")
            .withScalarSchema("schema").withDataType("http://www.w3.org/2001/XMLSchema#string");

    assertThat( api.endPoints() ).hasSize(4);
